import React from "react";
import Toggle from '../toggle/toggle';

export default class useWn extends React.Component{
constructor(){
    super();
    this.state={
        show:true
    }
}

render(){

    return(
        <div>
        {
            this.state.show ? <Toggle/>:null
        }
            
            <button onClick={()=>{this.setState({show:!this.state.show})}}>Click Me!!</button>
        </div>
    )
}
}
